// frontend/src/pages/DoctorAppointments.jsx
import { useEffect, useState } from "react";
import { useAuth } from "../contexts/AuthContext";

export default function DoctorAppointments() {
  const { user, token } = useAuth();
  const [appointments, setAppointments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  // Fetch all appointments for this doctor
  useEffect(() => {
    const fetchAppointments = async () => {
      if (!token) return;

      try {
        const res = await fetch("http://localhost:5000/api/appointments/doctor", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        const data = await res.json();
        if (!res.ok) throw new Error(data.message || "Failed to fetch");
        setAppointments(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchAppointments();
  }, [token]);

  const handleAction = async (id, status) => {
    try {
      const res = await fetch(`http://localhost:5000/api/appointments/${id}`, {
        method: "PATCH",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ status }),
      });
      const data = await res.json();
      if (!res.ok) throw new Error(data.message || "Action failed");

      setAppointments((prev) =>
        prev.map((a) =>
          a._id === id ? { ...a, status: data.appointment.status, meetLink: data.appointment.meetLink } : a
        )
      );

      alert(`Appointment ${status}`);
    } catch (err) {
      alert(err.message);
    }
  };

  if (loading) return <p>Loading appointments...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;
  if (!appointments.length) return <p>No appointment requests yet.</p>;

  return (
    <div style={{ maxWidth: "900px", margin: "auto" }}>
      <h2>Appointment Requests</h2>
      <table>
        <thead>
          <tr>
            <th>Patient</th>
            <th>Date</th>
            <th>Time</th>
            <th>Status</th>
            <th>Meeting Link</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {appointments.map((a) => (
            <tr key={a._id}>
              <td>{a.patientName}</td>
              <td>{a.date}</td>
              <td>{a.time}</td>
              <td
                style={{
                  color:
                    a.status === "approved"
                      ? "green"
                      : a.status === "rejected"
                      ? "red"
                      : "gray",
                }}
              >
                {a.status}
              </td>
              <td>
                {a.status === "approved" && a.meetLink ? (
                  <a href={a.meetLink} target="_blank" rel="noopener noreferrer">
                    Join Meeting
                  </a>
                ) : (
                  "â€”"
                )}
              </td>
              <td>
                {a.status === "pending" && (
                  <>
                    <button onClick={() => handleAction(a._id, "approved")}>
                      Accept
                    </button>
                    <button onClick={() => handleAction(a._id, "rejected")}>
                      Reject
                    </button>
                  </>
                )}
                {a.status !== "pending" && <span>â€”</span>}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
